import axios from "axios";

const {
    player_id,
    player_name,
    hr,
    group
} = require('./players.json')

export async function fetchPlayers() {

    const players = await axios.get('./db/players.json', {
        responseType: 'json',
    })
        .then(function(response) {
            console.log(response)
        });

}
